The reported data represents consolidated data relating to the total claims of the global consolidated group's  banking offices (domestic and foreign) on entities located in foreign countries. Claims between offices of the same entity group are netted out. The reporting entity is the accounting consolidated entity  consisting of the licensed ADI and global subsidiaries whose business is financial and whose prime function is to grant credit, or whose assets are largely similar in nature to the reporting entity. This includes subsidiaries involved in banking, hire-purchase, factoring, bank-funded "warehousing", leasing, bond trading and those which trade in or underwrite securities. Entities involved in the following business activities should be excluded from the consolidated group:

(a) insurance (including friendly societies and health funds); 
(b) acting as manager, responsible entity, approved trustee, trustee or similar role in relation to funds management; 
(c) non-financial (commercial) operations; and 
(d) securitisation special purpose vehicles to which assets have been transferred in accordance with the requirements of Prudential Standard APS 120 Securitisation.

The reported data comprises information in relation to the Level 2 consolidated group of the entity approved and licensed as a deposit taking institution (ADI) by APRA.

(i) If the ADI is not a subsidiary of an authorised Non Operating Holding Company (NOHC) this comprises the consolidation of the ADI and all its subsidiary entities other than non-consolidated subsidiaries (see below); or 

(ii) if the ADI is a subsidiary of an authorised NOHC, the consolidation of the immediate parent NOHC of the ADI and all the immediate parent NOHC's subsidiary entities (including any ADIs and their subsidiary entities) other than non-consolidated subsidiaries (see below) unless APRA otherwise determines, in writing, a different Level 2 composition for a group of companies of which the ADI is a member; 

Consolidation at Level 2 must cover the global operations of an ADI and its subsidiary entities, as well as any other controlled banking entities, securities entities and other financial entities,  including all banking and other financial activities other than non-consolidated subsidiaries (see below), both regulated and unregulated, conducted within the banking group. 

Non-Consolidated entities are those entities involved in the following business activities: 
                          (a) insurance (including friendly societies and health funds); 
                          (b) acting as manager, responsible entity, approved trustee, trustee or similar role in relation to funds management; 
                          (c) non-financial (commercial) operations; and 
                          (d) securitisation special purpose vehicles to which assets have been transferred in accordance with the requirements of the relevant Prudential Standards.
